svg.script:
function stickmanAnimStart(guyId, animIds) {
  var key = guyId + 'Animating';
  if (document[key]) return;
  for (var i = 0; i < animIds.length; i++) {
    document.getElementById(animIds[i]).beginElement();
  }
  document[key] = true;
  // Safari somehow doesnt fire onend event, so we call end manually
  if (navigator.userAgent.search("Safari") >= 0 && navigator.userAgent.search("Chrome") < 0) {
    setTimeout(function() {
      stickmanAnimEnd(guyId);
    }, 3000);
  }
}

function stickmanAnimEnd(guyId) {
  document[guyId + 'Animating'] = false;
}
